import styled from 'styled-components';

const HomeContainer = styled.div`
width: 100%;
height: 100vh;
display: flex;
justify-content: center;
align-items: center;
background-color: lightblue;
font-size: 16px;
color: white;

@media (min-width: 768px) {
    font-size: 24px;
    width: 80%;
  }

`;

export const NavBar = styled.nav`
background-color: lightblue;
padding: 20px;
align-self: center;
`;


export default HomeContainer;
